const handleProjectGeneration = async (
    skills,
    skills_to_learn,
    author,
    interests,
    area_of_programming) => {
        let response = await fetch(apiUrl, {
            method: "post",
            headers: {
              "Content-Type": "application/json",
            },
            body: JSON.stringify({ email: email, password: password }),
          });
}

export default handleProjectGeneration
